import React, { useState } from "react";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import { Button } from "react-bootstrap";
import Styles from "./NavList.module.css";
import { Redirect } from "react-router-dom";
export default function NavList(props) {
	const { index } = props;
	const [route, setRoute] = useState("/home"); // default route after log in
	return (
		<div className={Styles.container}>
			<List>
				<ListItem>
					<Button onClick={() => setRoute("/home")}>Home</Button>
				</ListItem>
				<ListItem>
					<Button onClick={() => setRoute("/profile")}>Profile</Button>
				</ListItem>
				<ListItem>
					<Button onClick={() => setRoute("/profile")}>Notifications</Button>
				</ListItem>
				<ListItem>
					<Button onClick={() => setRoute("/profile")}>Messages</Button>
				</ListItem>
				<ListItem>
					<Button onClick={() => setRoute("/profile")}>Bookmarks</Button>
				</ListItem>
				<ListItem>
					<Button onClick={() => setRoute("/profile")}>More</Button>
				</ListItem>
				<ListItem>
					<Button onClick={() => setRoute("/profile")}>Quote</Button>
				</ListItem>
				<Redirect to={route}></Redirect>
			</List>
		</div>
	);
}
